	private static final MyLatLng SCHAUMBURG = new MyLatLng(42.033739,-88.06469);
	private static final MyLatLng CHICAGO = new MyLatLng(41.878114, -87.629798);
	
	
	public void testDecodeFromGoogleDirJSON(){

		GoogleDirJsonParams jsonParams;

		try {
			jsonParams = new GoogleDirJsonParams("");
			fail();
		} catch (Exception e) {
		}

		try {
			jsonParams = new GoogleDirJsonParams("testing");
			fail();
		} catch (Exception e) {
		}
		
		try {
			jsonParams = new GoogleDirJsonParams(GoogleDirJsonResponse);
			
			Assert.assertNotNull(jsonParams.getOverview_polyline());
			Assert.assertNotNull(jsonParams.getSteps());
			
			Step step = jsonParams.getSteps().get(0);
			Assert.assertEquals(22, step.duration.value);
			
		} catch (Exception e) {
			fail();
		}
	}
	
	public void testEncodeToGoogleDirQuery(){
		
		String testExpectedURI = "http://maps.googleapis.com/maps/api/directions/json?" +
				"origin=" + SCHAUMBURG.toSimpleString() + "&" + 
				"destination=" + CHICAGO.toSimpleString() + "&" +
				"sensor=true";
		
		String testActualURI = URIBuilder.toGoogleDirURI(SCHAUMBURG, CHICAGO);
		
		Assert.assertEquals(testExpectedURI, testActualURI);
		
	}

